import { useEffect, useState } from "react";
import axiosInstance from '../api/axiosInstance';


const Restaurants = () => {
    const [restaurantsAvailable, setRestaurantsAvailable] = useState([]);
    const [seeRestaurantsAvailable, setSeeRestaurantsAvailable] = useState(false);
    useEffect(() => {        
        async function fetchData() {
            try {
                const response = await axiosInstance.get('/restaurants', {
                    params: { limit: 10, offset: 0 }
                });
                console.log('Restaurants data:', response.data);
                setRestaurantsAvailable(response.data);
            } catch (error) {
                console.error('Error fetching restaurants:', error);
            }
        }
        fetchData();
    }, []);

    return (
        <div>
            <h2>Restaurants Component</h2>
            <button onClick={() => setSeeRestaurantsAvailable(!seeRestaurantsAvailable)}>
                {seeRestaurantsAvailable ? 'Hide' : 'Show'} Available Restaurants
            </button>

            {seeRestaurantsAvailable && restaurantsAvailable.map((restaurant) => (
                <div key={restaurant.id}>
                    <h3>{restaurant.name}</h3>
                    <p>{restaurant.description}</p>
                </div>
            ))}
        </div>
    );
}
